import {
	BrowserRouter as Router,
	Switch,
	Route,
	Link //move page without refreshing browser
} from "react-router-dom";
import Home from "./routes/Home"
import Detail from "./routes/Detail"

function App() {
	return (
	<Router>
			<Route path="/hello">
					<h1>Hello</h1>
				</Route>
			<Route path="/movie/:id">
				<Detail />
			</Route>
			<Route path="/">
				<Home />
			</Route>
	</Router>
	);
}

export default App;
